import React from "react";
import NavbarComponent from "../Components/Navbar_component";
import Footer from "../Components/Footer";
import AboutComponent from "../Components/AboutComponent"

const About = () => {
  return (
    <div>
      <NavbarComponent />
      <AboutComponent />
      <Footer />
    </div>
  );
};

export default About;
